    false,nt"url": null,nt"notes": "The purpose of this Land Protection Plan
    is to provide landowners with a brief document that details the Service's potential
    acquisition methods, policy, and priorities. This project is in support of the Service's
    North American Waterfowl Management Plan which places a high priority on the acquisition
    of black duck wintering and migration habitat along the Atlantic Coast. The project
    is also in support of the Service's National Wetlands Priority Conservation Plan
    which recognizes wetlands for a variety of functions in addition to wildlife and
    fisheries values.",nt"license_title": "License Not Specified",nt"extras":
